import React, { Component } from 'react';
import {elements} from '../datos/datos';

class Elements extends Component {
    constructor(){
        super();
        this.state={
            elements
        }
    }
    render() {
        return (
            <div className="row">

            </div>
        );
    }
}
export default Elements;
